import { Helmet } from 'react-helmet-async';
import { faker } from '@faker-js/faker';
// @mui
import { useTheme } from '@mui/material/styles';
import { Grid, Container, Typography } from '@mui/material';
// components
import Iconify from '../components/iconify';
// sections
import {
  AppTasks,
  AppNewsUpdate,
  AppOrderTimeline,
  AppCurrentVisits,
  AppWebsiteVisits,
  AppTrafficBySite,
  AppWidgetSummary,
  AppCurrentSubject,
  AppConversionRates,
} from '../sections/@dashboard/app';
import { useAuth } from '../context/supaContex';
import ChatBubble from 'src/layouts/chatbot/chatbot';

// ----------------------------------------------------------------------

export default function PAC() {
  const theme = useTheme();
  const { user, linkPAC } = useAuth();
  const chatUrl = 'https://mediafiles.botpress.cloud/634d2b82-4a73-4676-85d7-764180e85b0f/webchat/bot.html';

  return (
    <>
      {/*<Helmet>
        <title> GADM RIOBAMBA </title>
      </Helmet>

      <Container maxWidth="xl" style={{height: '160%', marginTop: '-7.5%', paddingTop: '2%',position: 'relative', width: '100%', overflow: 'hidden'}}>
      <iframe
        title="DASHBOARD"
        src="https://docs.google.com/spreadsheets/d/1th1pwRKEYJeeEW52oobjJdZXhQv-9wFUMZbc_FwNfiQ/edit#gid=432656252"
        style={{ position: 'absolute', top: '-30%', left: '0', width: '100%', height: '160%', border: 'none' }}
        allowFullScreen
      />
      
    </Container>
  <ChatBubble url={chatUrl} />*/}

<Helmet>
        <title> GADM RIOBAMBA </title>
      </Helmet>

      <Container maxWidth="xl" 
      style={{height: '100%', // Cambiado a 100%
        marginTop: '0', // Eliminado el margen superior negativo
        position: 'relative',
        width: '100%',
        overflow: 'hidden',
        paddingBottom: '50%',}}>
      <iframe
        title="DASHBOARD"
        src="https://docs.google.com/spreadsheets/d/1th1pwRKEYJeeEW52oobjJdZXhQv-9wFUMZbc_FwNfiQ/edit?pli=1#gid=432656252"
        style={{ position: 'absolute', left: '0', width: '100%', height: '160%', border: 'none' }}
        allowFullScreen
      />
      
    </Container>
    <ChatBubble url={chatUrl} />



    </>
  );
}
